import React, { Component } from 'react';

class ProductBody extends Component{

    render(){
        return(
            <header class="producthead text-white text-center">
            <div class="overlay"></div>
            <div class="container">
                <div class="row">
                    <div class="col-xl-9 mx-auto">
                        <h1 class="mb-5">
                           This is a products Page!</h1>
                    </div>
                </div>
            </div>
    </header>
        );
    }
}

export default ProductBody;
